import { Link } from "react-router-dom";
import chatIcon from "../img/chatIcon.png";
import "./Layout.css"

export default function Layout(){
    return(
        <>
            <div className="AppList">
                <Link to="/chat" className="LinkToApp">
                    <img src={chatIcon} className="AppImage"/>
                </Link>

            </div>
            
        </>
    )
}
